module.exports = {
  root: true,
  parser: '@typescript-eslint/parser',
  plugins: [ '@typescript-eslint' ],
  overrides: [
    {
      files: [ '*.ts', '*.tsx' ],
      rules: {
        '@typescript-eslint/no-shadow': [ 'error' ],
        'no-shadow': 'off',
        'no-undef': 'off',
        'react-native/no-raw-text': 'off',
      },
      extends: [
        'akveo/react-native:recommended',
      ],
    },
  ],
  parserOptions: {
    project: [ './tsconfig.json' ],
    sourceType: 'module',
  },
  settings: {
    react: {
      version: '18.0.0',
    },
  },
  ignorePatterns: ["src/template-js", "src/template-ts"]
};

const path = require('path');

const gulpPath = path.join(__dirname, 'scripts');

require('ts-node').register({ project: path.resolve('tsconfig.json') });
require(path.join(gulpPath, 'gulpfile'));

module.exports = {
  preset: 'react-native',
  cacheDirectory: '<rootDir>/dist/jest/cache',
  coverageDirectory: '<rootDir>/dist/jest/coverage',
  moduleFileExtensions: [
    'ts',
    'tsx',
    'js',
  ],
  modulePathIgnorePatterns: [
    '<rootDir>/src/showcases/',
    '<rootDir>/src/template-js/',
    '<rootDir>/src/template-ts/',
  ],
  testPathIgnorePatterns: [
    '<rootDir>/node_modules',
    '<rootDir>/dist',
    '<rootDir>/docs',
  ],
};
